import React from "react";
import ReactDom from "react-dom";
import Heading from "./Header.jsx";
import Footer from "./Footer.jsx";
import Note from "./Note.jsx";
import notes from "./note1.jx";

function CreateNote(note) {
  return <Note title={note[0].title} explanation={note[0].content} />;
}

function App() {
  return (
    <div>
      <Heading />
      <Note title="golabi" explanation="havij" />
      <Footer />
    </div>
  );
}

export default App;
